import { useState } from 'react';
import ProductListing from '../../components/ProductListing/ProductListing.js';
import './HomePage.css';
import { useCart } from '../../utilities/CartProvider';

function HomePage() {

  const { items } = useCart();

  const [products, setProducts] = useState([
    { name: 'Mac book air pro1', price: 99.99, yearOfProduction: '2022', color: 'RED', condition: 'new' },
    { name: 'Mac book air pro2', price: 99.99, yearOfProduction: '2022', color: 'RED', condition: 'new' },
    { name: 'Mac book air pro3', price: 99.99, yearOfProduction: '2022', color: 'RED', condition: 'new' },
    { name: 'Mac book air pro4', price: 99.99, yearOfProduction: '2022', color: 'RED', condition: 'new' },
    { name: 'Mac book air pro5', price: 99.99, yearOfProduction: '2022', color: 'RED', condition: 'new' },
    { name: 'Mac book air pro7', price: 99.99, yearOfProduction: '2022', color: 'RED', condition: 'new' }
  ]);

  return (
    <>
        <div className='homepage'>
          <div className='homepage-listing-wrapper'>
            <div className='homepage-listings'>
              {products.map((product, index) => (
                <ProductListing key={index} product={product} />
              ))}
            </div>
          </div>
        </div>
    </>
  );
}

export default HomePage;
